#
# Customized Rossi solution.
#
from typing import List

class Solution:
    def findLongestChain(self, pairs: List[List[int]]) -> int:
        pairs.sort()
        # longest_ending_at[i] = longest sequence ending with pairs[i].
        longest_ending_at = []
        for pair in pairs:
            #print(f'\tnumber, longest_ending_at = {pair}, {longest_ending_at}')
            # Longest sequence ending with pair.
            # Initially we form just [pair].
            best_seq = [pair]
            # Consider all the sequences found so far.
            for seq in longest_ending_at:
                # Can we extend it monotonically with pair?
                if seq[-1][1] < pair[0]:
                    # Does it lead to a longer sequence?
                    if len(seq) + 1 > len(best_seq):
                        best_seq = seq + [pair]
            # Store the result.
            longest_ending_at.append(best_seq)
            #print(f'\t\tnumber, longest_ending_at = {pair}, {longest_ending_at}')
        # Return the longest sequence.
        return len(max(longest_ending_at, key=len))

